import React from 'react';
import {
  Grid,
  Typography,
  Box,
  Chip,
  Avatar,
  LinearProgress,
} from '@mui/material';
import {
  SportsFootball,
  EmojiEvents,
  TrendingUp,
  Schedule,
} from '@mui/icons-material';
import { motion } from 'framer-motion';
import GlassCard from '../components/ui/GlassCard';
import GradientButton from '../components/ui/GradientButton';

const Dashboard: React.FC = () => {
  const containerVariants = {
    initial: { opacity: 0 },
    animate: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1,
      },
    },
  };

  const itemVariants = {
    initial: { y: 20, opacity: 0 },
    animate: {
      y: 0,
      opacity: 1,
      transition: {
        type: 'spring',
        stiffness: 300,
        damping: 24,
      },
    },
  };

  const statCards = [
    {
      title: 'Current Rank',
      value: '#12',
      icon: TrendingUp,
      color: '#4caf50',
      gradient: 'success',
      subtitle: 'National Ranking',
    },
    {
      title: 'Season Record',
      value: '8-2',
      icon: SportsFootball,
      color: '#1e88e5',
      gradient: 'primary',
      subtitle: 'Win-Loss Record',
    },
    {
      title: 'Achievements',
      value: '15',
      icon: EmojiEvents,
      color: '#ff9800',
      gradient: 'warning',
      subtitle: 'Total Unlocked',
    },
    {
      title: 'Next Game',
      value: '2 Days',
      icon: Schedule,
      color: '#26a69a',
      gradient: 'secondary',
      subtitle: 'vs Alabama',
    },
  ];

  const recentGames = [
    { opponent: 'Georgia', score: '28-21', result: 'W', date: 'Nov 25' },
    { opponent: 'Florida', score: '35-14', result: 'W', date: 'Nov 18' },
    { opponent: 'Tennessee', score: '17-24', result: 'L', date: 'Nov 11' },
    { opponent: 'Kentucky', score: '42-7', result: 'W', date: 'Nov 4' },
  ];

  const upcomingGames = [
    { opponent: 'Alabama', date: 'Dec 2', time: '3:30 PM', rank: '#1' },
    { opponent: 'LSU', date: 'Dec 9', time: '7:00 PM', rank: '#8' },
  ];

  return (
    <motion.div
      variants={containerVariants}
      initial="initial"
      animate="animate"
    >
      <Box sx={{ mb: 4 }}>
        <motion.div variants={itemVariants}>
          <Typography
            variant="h3"
            sx={{
              fontWeight: 700,
              mb: 1,
              background: 'linear-gradient(135deg, #42a5f5, #66bb6a)',
              backgroundClip: 'text',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
            }}
            pt="20"
          >
            Dashboard
          </Typography>
          <Typography variant="h6" color="text.secondary">
            Welcome back, Coach! Here's your team overview.
          </Typography>
        </motion.div>
      </Box>

      <Grid container spacing={3}>
        {/* Stat Cards */}
        {statCards.map((stat, index) => (
          <Grid item xs={12} sm={6} lg={3} key={stat.title}>
            <motion.div variants={itemVariants}>
              <GlassCard gradient>
                <Box sx={{ p: 3 }}>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    <Avatar
                      sx={{
                        background: `linear-gradient(135deg, ${stat.color}22, ${stat.color}44)`,
                        color: stat.color,
                        mr: 2,
                      }}
                    >
                      <stat.icon />
                    </Avatar>
                    <Box>
                      <Typography variant="h4" sx={{ fontWeight: 700 }}>
                        {stat.value}
                      </Typography>
                      <Typography variant="body2" color="text.secondary">
                        {stat.subtitle}
                      </Typography>
                    </Box>
                  </Box>
                  <Typography variant="h6" color="text.primary">
                    {stat.title}
                  </Typography>
                </Box>
              </GlassCard>
            </motion.div>
          </Grid>
        ))}

        {/* Recent Games */}
        <Grid item xs={12} lg={6}>
          <motion.div variants={itemVariants}>
            <GlassCard>
              <Box sx={{ p: 3 }}>
                <Typography variant="h5" sx={{ mb: 3, fontWeight: 600 }}>
                  Recent Games
                </Typography>
                {recentGames.map((game, index) => (
                  <Box
                    key={index}
                    sx={{
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'space-between',
                      py: 2,
                      borderBottom: index < recentGames.length - 1 ? '1px solid rgba(255,255,255,0.1)' : 'none',
                    }}
                  >
                    <Box sx={{ display: 'flex', alignItems: 'center' }}>
                      <Chip
                        label={game.result}
                        size="small"
                        sx={{
                          background: game.result === 'W' 
                            ? 'linear-gradient(135deg, #4caf50, #66bb6a)'
                            : 'linear-gradient(135deg, #f44336, #e57373)',
                          color: 'white',
                          fontWeight: 600,
                          mr: 2,
                        }}
                      />
                      <Typography variant="body1" sx={{ fontWeight: 600 }}>
                        vs {game.opponent}
                      </Typography>
                    </Box>
                    <Box sx={{ textAlign: 'right' }}>
                      <Typography variant="body1" sx={{ fontWeight: 600 }}>
                        {game.score}
                      </Typography>
                      <Typography variant="body2" color="text.secondary">
                        {game.date}
                      </Typography>
                    </Box>
                  </Box>
                ))}
              </Box>
            </GlassCard>
          </motion.div>
        </Grid>

        {/* Upcoming Games */}
        <Grid item xs={12} lg={6}>
          <motion.div variants={itemVariants}>
            <GlassCard>
              <Box sx={{ p: 3 }}>
                <Typography variant="h5" sx={{ mb: 3, fontWeight: 600 }}>
                  Upcoming Games
                </Typography>
                {upcomingGames.map((game, index) => (
                  <Box
                    key={index}
                    sx={{
                      p: 2,
                      mb: index < upcomingGames.length - 1 ? 2 : 0,
                      background: 'linear-gradient(135deg, rgba(255,255,255,0.1), rgba(255,255,255,0.05))',
                      borderRadius: '12px',
                      border: '1px solid rgba(255,255,255,0.1)',
                    }}
                  >
                    <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
                      <Box>
                        <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                          <Typography variant="h6" sx={{ fontWeight: 600, mr: 1 }}>
                            vs {game.opponent}
                          </Typography>
                          <Chip
                            label={game.rank}
                            size="small"
                            sx={{
                              background: 'linear-gradient(135deg, #ff9800, #ffb74d)',
                              color: 'white',
                              fontWeight: 600,
                            }}
                          />
                        </Box>
                        <Typography variant="body2" color="text.secondary">
                          {game.date} • {game.time}
                        </Typography>
                      </Box>
                      <GradientButton size="small">
                        View Details
                      </GradientButton>
                    </Box>
                  </Box>
                ))}
              </Box>
            </GlassCard>
          </motion.div>
        </Grid>

        {/* Team Progress */}
        <Grid item xs={12}>
          <motion.div variants={itemVariants}>
            <GlassCard>
              <Box sx={{ p: 3 }}>
                <Typography variant="h5" sx={{ mb: 3, fontWeight: 600 }}>
                  Season Progress
                </Typography>
                <Grid container spacing={3}>
                  <Grid item xs={12} md={4}>
                    <Box sx={{ mb: 2 }}>
                      <Typography variant="body1" sx={{ mb: 1 }}>
                        Conference Standing
                      </Typography>
                      <LinearProgress
                        variant="determinate"
                        value={75}
                        sx={{
                          height: 8,
                          borderRadius: 4,
                          background: 'rgba(255,255,255,0.1)',
                          '& .MuiLinearProgress-bar': {
                            background: 'linear-gradient(90deg, #1e88e5, #42a5f5)',
                            borderRadius: 4,
                          },
                        }}
                      />
                      <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
                        3rd in SEC East
                      </Typography>
                    </Box>
                  </Grid>
                  <Grid item xs={12} md={4}>
                    <Box sx={{ mb: 2 }}>
                      <Typography variant="body1" sx={{ mb: 1 }}>
                        Bowl Eligibility
                      </Typography>
                      <LinearProgress
                        variant="determinate"
                        value={100}
                        sx={{
                          height: 8,
                          borderRadius: 4,
                          background: 'rgba(255,255,255,0.1)',
                          '& .MuiLinearProgress-bar': {
                            background: 'linear-gradient(90deg, #4caf50, #66bb6a)',
                            borderRadius: 4,
                          },
                        }}
                      />
                      <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
                        Qualified
                      </Typography>
                    </Box>
                  </Grid>
                  <Grid item xs={12} md={4}>
                    <Box sx={{ mb: 2 }}>
                      <Typography variant="body1" sx={{ mb: 1 }}>
                        Playoff Chances
                      </Typography>
                      <LinearProgress
                        variant="determinate"
                        value={45}
                        sx={{
                          height: 8,
                          borderRadius: 4,
                          background: 'rgba(255,255,255,0.1)',
                          '& .MuiLinearProgress-bar': {
                            background: 'linear-gradient(90deg, #ff9800, #ffb74d)',
                            borderRadius: 4,
                          },
                        }}
                      />
                      <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
                        45% chance
                      </Typography>
                    </Box>
                  </Grid>
                </Grid>
              </Box>
            </GlassCard>
          </motion.div>
        </Grid>
      </Grid>
    </motion.div>
  );
};

export default Dashboard;
